import { FC } from "react"
import { Link } from "react-router-dom";
import { ListItemWrapper } from "./ListItem.styled";

const ListItem: FC<any> = ({item}) => {
    return (
        <Link to={item.name}>

        <ListItemWrapper>
            ListItem = {item.name}
        </ListItemWrapper>
        </Link>
    )
}

export default ListItem;
